#ifndef ASPOSE_CELLS_PASTEOPERATIONTYPE_H
#define ASPOSE_CELLS_PASTEOPERATIONTYPE_H

namespace Aspose { namespace Cells {

/// <summary>
/// Represents operation type when pasting range.
/// </summary>
enum class PasteOperationType {
    /// <summary>
    /// No operation.
    /// </summary>
    None,
    /// <summary>
    /// Add
    /// </summary>
    Add,
    /// <summary>
    /// Subtract
    /// </summary>
    Subtract,
    /// <summary>
    /// Multiply
    /// </summary>
    Multiply,
    /// <summary>
    /// Divide
    /// </summary>
    Divide,
};

} }

#endif
